import { Carousel } from 'react-bootstrap';
import image1 from './onlineshopping5.jpg';
import image2 from './onlineshopping2.jpg';
import image3 from './onlineshopping3.jpg';

function HomeSlideShow() {
  return (
    <Carousel data-bs-theme="dark" interval={500}>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={image1}
          alt="First slide"
          style={{ width: '100%', height: '300px', objectFit: 'cover' }}
        />
        <Carousel.Caption>
          <h5>First slide label</h5>
          <p>Shop Smart, Live Smart: TratronE-Commerce Destination</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={image2}
          alt="Second slide"
          style={{ width: '100%', height: '300px', objectFit: 'cover' }}
        />
        <Carousel.Caption>
          <h5>Second slide label</h5>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={image3}
          alt="Third slide"
          style={{ width: '100%', height: '300px', objectFit: 'cover' }}
        />
        <Carousel.Caption>
          <h5>Third slide label</h5>
          <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default HomeSlideShow;
